('1914','6','7629','Haus Micheal Brock',Null,'Gepflegtes Ferienhaus am Golfplatz II in Santa Ponsa ','24122','Direkt am Golfplatz II von Santa Ponsa steht dieses elegante Ferienhaus auf einem 660 m² großen Grundstück.\r\nÜber einen kleinen Vorgarten betritt man das Erdgeschoss mit Diele, Wohn-Esszimmer, Küche mit Hauswirtschaftsraum, Gäste-WC und einem Schlafzimmer mit Bad en suite.\r\nIm Obergeschoss befinden sich 2 weitere Schlafzimmer mit je einem Badzimmer en suite.\r\nDer private Pool sowie die überdachte Terrasse laden zum Entspannen ein.\r\nZur Ausstattung gehören ein Kaminofen, Aluminium-Doppelglasfenster, Aluminium-Fensterläden, Einbauküche und eine Klimaanlage w/k. Ein großer Gemeinschaftspool kann ebenso mitgenutzt werden.','24123','795000','111','2012-11-09 14:21:06','110','2012-11-09 14:21:42','1679','1637','121','791',1,'1','0',Null,Null,Null,'24124',Null,'0','0','0',Null,'2016-03-31 14:10:17',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'24125',Null,'24126',Null,'24127',Null,'24128',Null,'24129','0',0,'5');
